import * as React from "react";
import Cell, { CellProps } from "./Cell";

export type RowProps = {
  onCellClick: CellProps["onClick"];
  row: CellProps["owner"][];
  indexRow: number
};

const Row: React.FC<RowProps> = rowProps => {
  return (
    <tr>
      {rowProps.row.map((cell, index) => (
        <Cell owner={cell} onClick={() => {}}/>
      ))}
    </tr>
  );
};

export default Row;
